MTax tax = MTax.get(_Ctx, _FiscalDocument.get_ValueAsInt("C_Tax_ID"));
if(tax != null 
    && tax.getRate() != null) {
    double taxRate = tax.getRate().setScale(2, BigDecimal.ROUND_HALF_UP).doubleValue();
    if(taxRate == 0)
        result = " ";
    else if(taxRate == 8)
        result = "\"";
    else if(taxRate == 12)
        result = "!";
    else if(taxRate == 22)
        result = "#";
}

